        public static double Bilinearinterpolation(double[,] z, double trval, double prval, out List<double> Ts, out List<double> Ps, out List<double> Zs)
        {
            //calculates single point  bilinear int erpolation
            double zval = 0.0;
            Zs = new List<double>();
            Ts = new List<double>();
            Ps = new List<double>();

            double Tlower = 0, TUpper = 0, Plower = 0, PUpper = 0;
            int TlowerIndex = 0, TUpperIndex = 0, PlowerIndex = 0, PUpperIndex = 0;

            if ((trval >= 0.001 && trval <= 4) && (prval >= 0.001 && prval <= 15))
            {
                for (int i = 0; i < TList.Length; i++)
                {
                    if (trval >= TList[i] && trval <= TList[i + 1])
                    {
                        Tlower = TList[i];
                        TUpper = TList[i + 1];
                        TlowerIndex = i;
                        TUpperIndex = i + 1;

                        Ts.Add(Tlower);
                        Ts.Add(TUpper);
                    }
                }

                for (int i = 0; i < PList.Length; i++)
                {
                    if (prval >= PList[i] && prval <= PList[i + 1])
                    {
                        Plower = PList[i];
                        PUpper = PList[i + 1];
                        PlowerIndex = i;
                        PUpperIndex = i + 1;
                        Ps.Add(Plower);
                        Ps.Add(PUpper);
                    }
                }

                double Y = trval;
                double X = prval;
                double Y1 = Tlower;
                double Y2 = TUpper;
                double X1 = Plower;
                double X2 = PUpper;

                double Q11 = z[TlowerIndex, PlowerIndex];
                double Q12 = z[TUpperIndex, PlowerIndex];
                double Q21 = z[TlowerIndex, PUpperIndex];
                double Q22 = z[TUpperIndex, PUpperIndex];

                zval = Q11 * (X2 - X) * (Y2 - Y) / ((X2 - X1) * (Y2 - Y1)) +
                       Q12 * (X2 - X) * (Y - Y1) / ((X2 - X1) * (Y2 - Y1)) +
                       Q21 * (X - X1) * (Y2 - Y) / ((X2 - X1) * (Y2 - Y1)) +
                       Q22 * (X2 - X) * (Y - Y1) / ((X2 - X1) * (Y2 - Y1));

                Zs.Add(Q11);
                Zs.Add(Q12);
                Zs.Add(Q21);
                Zs.Add(Q22);

                return zval;
            }
            else
            {
                zval = double.NaN;
            }

            return zval;
        }

        public static double Bilinearinterpolation(double Y, double X, double XLower, double XUpper, double Ylower, double YUpper, double Val11, double Val12, double Val21, double Val22)
        {
            double zval =
                   Val11 * (XUpper - X) * (YUpper - Y) / ((XUpper - XLower) * (YUpper - Ylower)) +
                   Val12 * (XUpper - X) * (Y - Ylower) / ((XUpper - XLower) * (YUpper - Ylower)) +
                   Val21 * (X - XLower) * (YUpper - Y) / ((XUpper - XLower) * (YUpper - Ylower)) +
                   Val22 * (XUpper - X) * (Y - Ylower) / ((XUpper - XLower) * (YUpper - Ylower));

            return zval;
        }
